import React from "react";
import "./Home.css";

class Home extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div className="main">
        <div className="bg-img">
          <div className="navbar-div">
            <ul>
              <li className="logo">
                <a href="#home">LOGO</a>
              </li>
              <li>
                <a href="#about">CONTACT US</a>
              </li>
              <li>
                <a href="#about">FAQ</a>
              </li>
              <li>
                <a href="#contact">SERVICE</a>
              </li>
              <li>
                <a href="#news">PRICE</a>
              </li>
              <li>
                <a href="#home">ABOUT US</a>
              </li>
            </ul>
          </div>
        </div>
        <div></div>
        <div className="contents-div"></div>
        <div className="footer-div"></div>
      </div>
    );
  }
}

export default Home;
